import React from 'react';

export default function SVGFog({ className }) {
  return (
    <svg
      className={className}
      width="1000"
      height="1000"
      viewBox="0 0 1000 1000"
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      // No blur for debug
    >
      {/* Debug: solid red ellipse, full opacity */}
      <ellipse cx="0" cy="1000" rx="600" ry="400" fill="#f00" fillOpacity="1" />
    </svg>
  );
}
